//rcc tab
import React, { Component, Dropdown, SplitButton } from "react";
import "./Components.css";

class NavbarComponent extends Component {
  render() {
    return (
      <div class="navbarContainer">
        <div>
          <a
            class="nav-link itemText nav-link"
            aria-current="page"
            href="/Homepage"
          >
            ANASAYFA
          </a>
        </div>
        {["Primary", "Secondary", "Success", "Info", "Warning", "Danger"].map(
          (variant) => (
            <SplitButton
              key={variant}
              id={`dropdown-split-variants-${variant}`}
              variant={variant.toLowerCase()}
              title={variant}
            >
              <Dropdown.Item eventKey="1">Action</Dropdown.Item>
              <Dropdown.Item eventKey="2">Another action</Dropdown.Item>
              <Dropdown.Item eventKey="3" active>
                Active Item
              </Dropdown.Item>
              <Dropdown.Divider />
              <Dropdown.Item eventKey="4">Separated link</Dropdown.Item>
            </SplitButton>
          )
        )}
        <div>
          <a class="nav-link itemText nav-link" href="#">
            PROFİL
          </a>
        </div>
        <div>
          <a class="nav-link itemText nav-link" href="/Products">
            ÜRÜNLER
          </a>
        </div>
        <div>
          <a class="nav-link itemText nav-link" href="/Contact">
            İLETİŞİM
          </a>
        </div>
      </div>
    );
  }
}
export default NavbarComponent;
